import React from "react";
import { Link } from "react-router-dom";

export default function LocationItem({
  imagePath,
  text,
  label,
  location,
  path,
}) {
  return (
    <div className="location">
      <Link className="location__link" to={path}>
        <figure className="location__picture" data-category={label}>
          <img src={imagePath} alt="travel-img" className="location__image" />
        </figure>
        <div className="location__text">{text}</div>
        <div className="location__destination-name">{location}</div>
      </Link>
    </div>
  );
}
